import React from "react";
import plants from "../../plants.json";
import PlantCard from "../../components/PlantCard";

class Products extends React.Component {

    render() {
        return(
            plants.map(({id, plantName, image, price, stock}) => (
                <PlantCard
                  id={id}
                  key={id}
                  plantName={plantName}
                  image={image}
                  price={price}
                  stock={stock}
                />
              ))
        )
    }
}

export default Products;
